import React from "react";
import Heading from "./Heading";
import Greeting from "./Greeting";
import Calculation from "./Calculation";
import ImagesComp from "./ImagesComp";
import Cards from "./Cards";
import Sdata from "./Sdate";

function ncard(val) {
  return (
    <Cards
      imgSrc={Sdata[0].imgSrc}
      cardCategory={Sdata[0].cardCategory}
      seriesname={Sdata[0].seriesname}
      hrefLink={Sdata[0].hrefLink}
    />
  );
}

function App() {
  return (
    <>
      <Heading />
      <Greeting></Greeting>
      <ImagesComp></ImagesComp>
      <Calculation></Calculation>
      <div className="AllCards">
        <Cards
          imgSrc={Sdata[1].imgSrc}
          cardCategory={Sdata[1].cardCategory}
          seriesname={Sdata[1].seriesname}
          hrefLink={Sdata[1].hrefLink}
        />
        <Cards
          imgSrc={Sdata[2].imgSrc}
          cardCategory={Sdata[2].cardCategory}
          seriesname={Sdata[2].seriesname}
          hrefLink={Sdata[2].hrefLink}
        />
        <Cards
          imgSrc={Sdata[2].imgSrc}
          cardCategory={Sdata[2].cardCategory}
          seriesname={Sdata[2].seriesname}
          hrefLink={Sdata[2].hrefLink}
        />
        <Cards
          imgSrc={Sdata[2].imgSrc}
          cardCategory={Sdata[2].cardCategory}
          seriesname={Sdata[2].seriesname}
          hrefLink={Sdata[2].hrefLink}
        />

        {/* <Cards sdata={Sdata} /> */}
      </div>
    </>
  );
}

export default App;
